import React from 'react';

export default function LoginEstabelecimento() {
    return (
        <div className="hold-transition lockscreen">
            {/* Automatic element centering */}
            <div className="lockscreen-wrapper">
                <div className="lockscreen-logo">
                    <a href="../../index2.html"><b>Admin</b>LTE</a>
                </div>
                {/* User name */}
                <div className="lockscreen-name">John Doe</div>
                {/* START LOCK SCREEN ITEM */}
                <div className="lockscreen-item">
                    {/* lockscreen image */}
                    <div className="lockscreen-image">
                        <img src="../../dist/img/user1-128x128.jpg" alt="User Image" />
                    </div>
                    {/* /.lockscreen-image */}
                    {/* lockscreen credentials (contains the form) */}
                    <form className="lockscreen-credentials">
                        <div className="input-group">
                            <input type="password" className="form-control" placeholder="password" />
                            <div className="input-group-append">
                                <button type="button" className="btn"><i className="fas fa-arrow-right text-muted" /></button>
                            </div>
                        </div>
                    </form>
                    {/* /.lockscreen credentials */}
                </div>
                {/* /.lockscreen-item */}
                <div className="help-block text-center">
                    Enter your password to retrieve your session
    </div>
                <div className="text-center">
                    <a href="login.html">Or sign in as a different user</a>
                </div>
                <div className="lockscreen-footer text-center">
                    Copyright © 2014-2019 <b><a href="http://adminlte.io" className="text-black">AdminLTE.io</a></b><br />
      All rights reserved
    </div>
            </div>
            {/* /.center */}
            {/* jQuery */}
            {/* Bootstrap 4 */}
        </div>

    );
}
